import React from 'react';

const Section = (props) => {
    return (
        <section style={{
            width:"100%",
            height:"900vh",
            backgroundColor: "lightblue",
            zIndex:"-1",
        }}>


<div>
{props.card3}
</div>

<h1>{props.name}</h1>

        </section>
    );
};

export default Section;
